}
#contact-us .form-container .primary-exit {
  position: absolute;
  right: 25px;
  top: 25px;
  width: 18px;
  height: 18px;
  font-family: dxcRegular;
  color: #666;
  background-color: transparent;
  border: none;
  transition: 0.4s all ease-in-out;
